import React from 'react';

const Register = () => {
    return (
        <div className="formContainer">
            <div className="formWrapper">
                <form>
                    <input type="text" />
                    <input type="email" />
                    <input type="password" />
                    <input type="file" />
                </form>
            </div>
        </div>
    );
}

export default Register;
